import Header from '../components/header';
import portrait from '../images/Anne Bonny.jpeg';
import Books from '../components/books';

function Home() {
    return (
        <div>
            <div className="container-fluid">
                <Header header="Anne Bonny" image={portrait}/>
                <div className="row justify-content">
                    <div className="col-7 mx-auto">
                        <h2>Anne Bonny (circa-1698)</h2>
                        <p>Abraham, or Bram, Stoker is most famous for writing the Gothic horror novel Dracula. But did you know that he also wrote romance novels? Or that he was bedridden as a child?</p><br/>
                        <p>Born in Dublin, Stoker was too sick to leave his house until the age of seven. During this time, he was told lots of Celtic stories, including tales of malevolent fairies who sometimes drank blood!</p><br/>
                        <p></p><br/>
                        <p></p>
                    </div>
                    <div className="container">
                        <Books query="Anne Bonny"/>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default Home;
